def convert_score_to_grade(score: int) -> str:
    """"""
    if score < 0:
        return 'Error: Invalid score. Score cannot be negative.'
    elif score > 100:
        return 'Error: Invalid score. Score cannot be greater than 100.'
    elif score > 95:
        return 'A+'
    elif score > 90:
        return 'A-'
    elif score > 85:
        return 'B+'
    elif score >= 80:
        return 'B'
    elif score >= 70:
        return 'C'
    elif score >= 60:
        return 'D'
    elif score >= 50:
        return 'E'
    else:
        return 'F'
